    render() {
        return (
            <Modal
                //show={props.show}
                show={show}
                onHide={props.handleClose}
                aria-labelledby="contained-modal-title-vcenter"
                centered
                animation={true}

            >
                <Modal.Header closeButton>
                    <Modal.Title id="contained-modal-title-vcenter"  >
                        Terror Success Predictor
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <h4>{props.title}</h4>
                    <p>
                        {props.content}
                    </p>
                </Modal.Body>
            </Modal>
        );

    }


}

export default ModalOver;
